func (asq *AssetScrapQuery) querySpec() *sqlgraph.QuerySpec {
	_spec := sqlgraph.NewQuerySpec(assetscrap.Table, assetscrap.Columns, sqlgraph.NewFieldSpec(assetscrap.FieldID, field.TypeUint64))
	_spec.From = asq.sql
	if unique := asq.ctx.Unique; unique != nil {
		_spec.Unique = *unique
	} else if asq.path != nil {
		_spec.Unique = true
	}
	if fields := asq.ctx.Fields; len(fields) > 0 {
		_spec.Node.Columns = make([]string, 0, len(fields))
		_spec.Node.Columns = append(_spec.Node.Columns, assetscrap.FieldID)
		for i := range fields {
			if fields[i] != assetscrap.FieldID {
				_spec.Node.Columns = append(_spec.Node.Columns, fields[i])
			}
		}
		if asq.withAsset != nil {
			_spec.Node.AddColumnOnce(assetscrap.FieldAssetID)
		}
		if asq.withManager != nil {
			_spec.Node.AddColumnOnce(assetscrap.FieldScrapOperateID)
		}
		if asq.withEmployee != nil {
			_spec.Node.AddColumnOnce(assetscrap.FieldScrapOperateID)
		}
		if asq.withMaintainer != nil {
			_spec.Node.AddColumnOnce(assetscrap.FieldScrapOperateID)
		}
		if asq.withAgent != nil {
			_spec.Node.AddColumnOnce(assetscrap.FieldScrapOperateID)
		}
	}
	if ps := asq.predicates; len(ps) > 0 {
		_spec.Predicate = func(selector *sql.Selector) {
			for i := range ps {
				ps[i](selector)
			}
		}
	}
	if limit := asq.ctx.Limit; limit != nil {
		_spec.Limit = *limit
	}
	if offset := asq.ctx.Offset; offset != nil {
		_spec.Offset = *offset
	}
	if ps := asq.order; len(ps) > 0 {
		_spec.Order = func(selector *sql.Selector) {
			for i := range ps {
				ps[i](selector)
			}
		}
	}
	return _spec
}

func (asq *AssetScrapQuery) sqlQuery(ctx context.Context) *sql.Selector {
	builder := sql.Dialect(asq.driver.Dialect())
	t1 := builder.Table(assetscrap.Table)
	columns := asq.ctx.Fields
	if len(columns) == 0 {
		columns = assetscrap.Columns
	}
	selector := builder.Select(t1.Columns(columns...)...).From(t1)
	if asq.sql != nil {
		selector = asq.sql
		selector.Select(selector.Columns(columns...)...)
	}
	if asq.ctx.Unique != nil && *asq.ctx.Unique {
		selector.Distinct()
	}
	for _, m := range asq.modifiers {
		m(selector)
	}
	for _, p := range asq.predicates {
		p(selector)
	}
	for _, p := range asq.order {
		p(selector)
	}
	if offset := asq.ctx.Offset; offset != nil {
		// limit is mandatory for offset clause. We start
		// with default value, and override it below if needed.
		selector.Offset(*offset).Limit(math.MaxInt32)
	}
	if limit := asq.ctx.Limit; limit != nil {
		selector.Limit(*limit)
	}
	return selector
}

